import React from 'react';
import './App.css';
import{Link} from 'react-router-dom';
import style from './sucre.module.css'

function Nav() {
    function showLogin(){
        let logIn = document.querySelector('#logIn');
        logIn.style.display = 'block';
    }
  return (
    <div className="nav">
        <nav>
            <h3>Logo</h3>
            <ul className="nav-links">
                <Link className={style.navStyle} to="/">
                    <li>Home</li>
                </Link>
                <Link className={style.navStyle} to="/menu">
                    <li>Menu</li>
                </Link>

                <Link className={style.navStyle} to="/about">
                    <li>About</li>
                </Link>
                <a className="btn-secondary navStyle" href="#logIn" onClick={showLogin}>
                    <li>Login</li>
                </a>
                <Link className=" navStyle btn-primary" to="/signup">
                    <li>SignUp</li>
                </Link>
            </ul>
        </nav>
    <LogIn />
    </div>
  );
}

export default Nav;
